import web_banner from "../assets/banners/web-course.png";

export const news = [
  { cover: web_banner, path: "/courses/html-css" },
  { cover: web_banner, path: "/courses/python-beginner" },
  { cover: web_banner, path: "/courses/python-advanced" },
];
